export default function ButtonBases() {
  return (
    <div>
      <AppBar
        position="static"
        style={{backgroundColor: "#777777"}}>
        <Toolbar>
          <Typography variant="h6" color="#000000">
            Princeton Tutoring Network Helpline
          </Typography>
        </Toolbar>
      </AppBar>
    </div>
  );
}
